static void check_nfsft(void)
{
  const int M = sizeof(theta)/sizeof(theta[0]);
  const int N = sqrt((R)(sizeof(f_hat)/sizeof(f_hat[0]))) - 1 ;
  NFSFT(plan) p;
  int j, k, n;
  
  NFSFT(precompute)(N, 1000.0, 0U, 0U);

  NFSFT(init)(&p, N, M);

  /* Nodes. */
  for (j = 0; j < M; j++)
  {
    p.x[2*j] = phi[j];
    p.x[2*j+1] = theta[j];
  }

  NFSFT(precompute_x)(&p);

  /* Fourier coefficients. */
  for (k = 0, j = 0; k <= p.N; k++)
    for (n = -k; n <= k; n++, j++)
      p.f_hat[NFSFT_INDEX(k,n,&p)] = f_hat[j];

  NFSFT(trafo)(&p);

  /* debug */
  for (j = 0; j < M; j++)
    fprintf(stderr, "f[%2d] = " FE_ " f[%2d] = " FE_ " err = " FE_ "\n", j,
      CREAL(f[j]), j, CREAL(p.f[j]), CABS(f[j] - p.f[j]) / CABS(f[j]));

  /* Standard NFFT error measure. */
  {
    R numerator = K(0.0);
    R denominator = K(0.0);
    for (j = 0; j < M; j++)
      numerator = MAX(numerator, CABS(f[j] - p.f[j]));
    for (j = 0; j < (N+1)*(N+1); j++)
      denominator += CABS(f_hat[j]);
    printf(FE_ "\n", numerator/denominator);
  }
}

int main(void)
{
  check_nfsft();
  return EXIT_SUCCESS;
}
